  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0116408 includes chemical,
  discrete sample, physical and profile data collected from POLARSTERN in the Arctic
  Ocean, Kara Sea and Laptev (or Nordenskjold) Sea from 1995-07-07 to 1995-09-20 and
  retrieved during cruise ARK-XI/1 and CARINA_06AQ19950707. These data include ALKALINITY,
  AMMONIUM, CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-113 (CFC-113), CHLOROFLUOROCARBON-12
  (CFC-12), DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE, Potential
  temperature (theta), RADIUM ISOTOPES, SALINITY, SILICATE, WATER TEMPERATURE and
  pH. The instruments used to collect these data include CTD and bottle. These data
  were collected by Leif Anderson of Gothenburg University; Department of Analytical
  and Marine Chemistry as part of the CARINA_06AQ19950707 data set.nnThe CARINA (CARbon
  dioxide IN the Atlantic Ocean) data synthesis project is an international collaborative
  effort of the EU IP CARBOOCEAN, and U.S. partners. It has produced a merged internally
  consistent data set of open ocean subsurface measurements for biogeochemical investigations,
  in particular, studies involving the carbon system. The original focus area was
  the North Atlantic Ocean, but over time the geographic extent expanded and CARINA
  now includes data from the entire Atlantic, the Arctic Ocean, and the Southern Ocean.\",\n\t\"owner_org\":
